import React from "react";
import axios from "axios";
import { useState, useEffect } from "react";
function Plan() {
  const [plan, setPlan] = useState({});

  useEffect(() => {
    async function getAllPlan() {
      try {
        const plan = await axios.get("http://127.0.0.1:8000/list/");

        console.log(plan.data);
      } catch (error) {
        console.log(error);
      }
    }
    getAllPlan();
  }, []);
  <h1>Connect with Django</h1>;
  return (
    <div>
      <h1>Hi this is plane...................</h1>
    </div>
  );
}

export default Plan;
